public function addToCart(Request $r)
{
    $proyek = Proyek::where('id', $r->proyek_id)->get();
    $add = Cart::add($proyek, $proyek[0]->nama, $r->qty, $proyek[0]->harga_paket);
    return json_encode('Added to cart!');
}

